import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

import Header from '../header';
import Offer from "../offer";
import Way from "../way";
import Program from "../program";
import Practice from "../practice";

const App = () => {
    return (
        <div>
            <Header/>
            <main>
                <Offer/>
                <Way/>
                <Program/>
                <Practice/>
            </main>
        </div>
    );
};

export default App;
